.asset {
    padding: 20px;
    .searchConditon {
        ::v-deep .el-tabs {
            height: 100%;
            .el-tabs__header {
                margin: 0;
                .el-tabs__nav-scroll {
                    .el-tabs__nav {
                        .el-tabs__active-bar {
                            background-color: transparent;
                        }
                    }
                }
                .el-tabs__nav-wrap::after {
                    background-color: transparent;
                }
            }
        }
        .search {
            display: flex;
            ::v-deep .el-input {
                width: 515px;
                height: 32px;
                margin-bottom: 8px;
                .el-input__inner {
                    height: 100%;
                }

                .el-button {
                    width: 75px;
                    height: 32px;
                    font-size: 14px;
                    background: #84C22E;
                    color: #fff;
                }
            }
        }
        .condition {
            .assetType {
                display: flex;
                align-items: center;
                font-size: 14px;
                color: #303133;
                margin-bottom: 8px;
                span {
                    margin-right: 8px;
                    font-weight: 700;
                    line-height: 40px;
                }
            }
            .fiterForm {
                display: flex;
                align-items: center;
                .input {
                    width: 85%;
                    display: flex;
                    flex-wrap: wrap;
                    margin: 8px 0;
                    .el-input {
                        width: 25%;
                        margin-bottom: 8px;
                        margin-right: 5%;
                    }
                }
            }
        }
    }
}
